import Layout from "../components/Layout";
import { Document, Page } from "react-pdf";

const Resume = () => (
  <Layout>
    <div>
      <div style={{ margin: "10vh 15vw" }}>
        <Document file="/files/Resume.pdf">
          <Page pageNumber={1} />
        </Document>
      </div>
    </div>
  </Layout>
);

export default Resume;
